INSERT INTO `book_library` (`id`, `bookName`, `bookDescription`, `bookAuthor`, `bookType`, `bookPrice`, `bookFile`, `bookState`) VALUES
(1, 'The Jetstream of Success', 'Each one of us has the capacity to become an Intellectual Maverick. We should be exhibiting qualities in life that are unique and dynamic. Achieving success is determined by our propensity for innovation.', 'Julian Pencilliah', 'traditional', '10.0', NULL, 1),
(2, 'How to be Successful in Present Day World', '\'How to be Successful in the Present Day World\' is motivational book. It is written after an in depth research to enlighten and help masses to achieve success in the present day world.', 'Pradeep Chaswal', 'traditional', '20.0', NULL, 1),
(3, 'Your Leadership EDGE', 'Your Leadership Edge is an innovative step-by-step resource for leaders written by Ravinder Tulsiani.', 'Ravinder Tulsiani', 'traditional', '26.0', NULL, 0),
(4, 'Outliers: The Story of Success', 'In this stunning new book, Malcolm Gladwell takes us on an intellectual journey through the world of \"outliers\"--the best and the brightest, the most famous and the most successful.', 'Malcolm Gladwell', 'electronic', '', 'book_59b8047c19122.jpg', 0),
(5, 'I am Enough Journal Affirmations for Girls', 'An affirmation on its own is a powerful thing. However, flexing the muscle of an affirmation with the conscious expression of your own words, thoughts and experiences is a transformative thing.', 'Elizabeth D. Gray', 'electronic', '', 'book_59b8046f5f628.jpg', 0);
