INSERT INTO `static_pages` (`id`, `pageTitle`, `pageContent`, `pageActive`) VALUES
(1, 'School modules', '<h3>Schoex modules</h3>\n\n<p>Schoex include multiple of modules that orchestrate together to define schoex services, here is the list of modules :</p>\n\n<ul>\n	<li>User groups : Administrators, teachers, students and parents</li>\n	<li>Registeration : Administrator must approve registerations of teachers, students or parents</li>\n	<li>Private messages : simple way to communicate with other users by messages</li>\n	<li>Mail / SMS : Administrators can send e-mail or SMS to teachers, students or parents</li>\n	<li>NewsBoard : Publish school news on board</li>\n	<li>Events : Publish scheduled events</li>\n	<li>Calender : List events, news, exams and online exams on calender</li>\n	<li>Attendance : Track attendance of students</li>\n	<li>Exams : Add exams scheduled for school students and grade levels</li>\n	<li>Assignments : Upload assignments related to each class</li>\n	<li>Online exams : Create online exams ( Multiple choice ) for students with auto marking</li>\n	<li>Dormitories : Add your school dormitories</li>\n	<li>Classes : Add your school classes</li>\n	<li>Class schedule : Create class schedule for each one</li>\n	<li>Subjects : Add subjects and their relation to teachers</li>\n	<li>Books library : Create online library by either download or book availability on library</li>\n</ul>\n', 0),
(2, 'School dashboard', '<h3>Dashboard</h3>\n\n<p>Beautifull dashboard provides you with quick statistics, upcoming news &amp; events, leaderboard (students &amp; teachers), calender and Quick links customized based on your user group</p>\n\n<p><img alt=\"undefined\" src=\"http://cr-house.com/apps/schoex/docs/img/6.png\" /></p>\n\n<h3>Users</h3>\n\n<p>List administrators on website : from left panel press Admins</p>\n\n<p><img src=\"http://cr-house.com/apps/schoex/docs/img/50.png\" /></p>\n\n<p>To add new administrator press Add administrator button</p>\n\n<p><img src=\"http://cr-house.com/apps/schoex/docs/img/51.png\" /></p>\n\n<p>List teachers on website : from left panel press Teachers</p>\n\n<p><img src=\"http://cr-house.com/apps/schoex/docs/img/52.png\" /></p>\n\n<p>To add new teacher press Add teacher button</p>\n\n<p><img alt=\"undefined\" src=\"http://cr-house.com/apps/schoex/docs/img/53.png\" /></p>\n\n<p>the same procedures for students and parents</p>\n', 1);
